INSERT INTO `ketentuan_layanan` (`id`, `nomer`, `tipe`, `konten`, `date`, `time`) VALUES
(2, '2', 'layanan', '<h3>Umum</h3><br>\r\n<h4>Dengan Menggunakan Layanan Reseller Network22, Kami Anggap Anda Telah Membaca Ketentuan Layanan Ini</h4><br>\r\nDengan mendaftar dan menggunakan layanan Reseller Network22, Anda secara otomatis menyetujui semua ketentuan layanan kami. Kami berhak mengubah ketentuan layanan ini tanpa pemberitahuan terlebih dahulu. Anda diharapkan membaca semua ketentuan layanan kami sebelum membuat pesanan.<br><br>\r\n\r\nReseller Network22 tidak akan bertanggung jawab jika Anda mengalami kerugian dalam bisnis Anda.<br><br>\r\n\r\nReseller Network22 tidak bertanggung jawab jika Anda atau Client Anda mengalami suspensi akun atau penghapusan kiriman yang dilakukan oleh Instagram, Twitter, Facebook, Youtube, dan lain-lain<br><br>\r\n\r\nReseller Network22 berhak melakukan perubahan pada Ketentuan Layanan tanpa adanya pemberitahuan sebelumnya kepada anda sebelumnya.<br><br>\r\n\r\nReseller Network22 tidak bertanggung jawab atas penutupan akun atau penghapusan gambar yang dilakukan oleh Instagram / Facebook / Youtube / Social Media lainnya.<br><br>\r\n\r\nReseller Network22 tidak menjamin waktu pengiriman pesanan Anda. Kami selalu berusaha memberikan yang terbaik pada pesanan Anda saat dikirimkan. Dan kami tidak akan melakukan pengembalian dana meskipun pesanan anda membutuhkan waktu yang cukup lama untuk di proses.<br><br><br>\r\n\r\n<h3>Layanan</h3><br>\r\nReseller Network22 hanya digunakan untuk media promosi sosial media dan membantu meningkatkan penampilan akun Anda saja.<br><br>\r\n\r\nReseller Network22 tidak menjamin pengikut baru Anda berinteraksi dengan Anda, kami hanya menjamin bahwa Anda mendapat pengikut yang Anda beli.<br><br>\r\n\r\nReseller Network22 tidak menerima permintaan pembatalan/pengembalian dana setelah pesanan masuk ke sistem kami. Kami memberikan pengembalian dana yang sesuai jika pesanan tidak dapat diselesaikan atau Partial.<br><br>\r\n\r\nNetwork22 tidak memberikan toleransi untuk akun yang ada pada kondisi privasi. Pastikan akun dalam kondisi publik sebelum melakukan pesanan<br><br>\r\n\r\n<h3>Pengembalian Dana</h3><br>\r\nTidak ada pencairan atau pengembalian dana pada saldo. Setelah melakukan deposit, tidak ada cara untuk mengembalikan dana tersebut. Anda harus menggunakannya untuk melakukan pesanan pada layanan kami.<br><br>\r\n\r\nAnda telah setuju bahwa setelah melakukan deposit Saldo. Anda tidak akan menuntut atau mengajukan sengketa melawan kami untuk alasan apapun.<br><br>\r\n\r\nJika Anda menuntut atau mengajukan sengketa kepada kami setelah deposit, kami berhak menutup akun Anda serta melarang Anda dari situs kami.<br><br>\r\n\r\nPesanan pada Reseller Network22 yang sudah di pesan tidak dapat kami batalkan atau mengembalikan Saldo. Anda hanya mendapat pengembalian Saldo jika pesanan Anda tidak dapat diproses.<br><br>\r\n\r\nData pesanan yang salah atau akun yang di privasi tidak dapat kami refund. Pastikan untuk mengecek terlebih dahulu sebelum memesan layanan kami.<br><br>\r\n\r\nAktivitas pengisian Saldo menggunakan dana yang tidak sah atau dana penipuan akan menyebabkan penutupan pada akun Anda. Tidak ada pengecualian.<br><br>\r\n\r\nJangan menggunakan lebih dari satu layanan untuk data yang sama. Network22 tidak dapat memberikan jumlah followers / likes yang tepat pada kasus ini. Tidak ada refund.<br><br><br><br>\r\n\r\n\r\n<h5>Diperbaharui : 04 Mei 2022</h5>', '2022-05-14', '11:57:20');
